import "./contentItem.css";
const ContentItem = (props) => {
  const { item } = props;
  return (
    <div className="itemSearch d-flex justify-content-between border-1">
      <div className="itemSearch__image">
        <img src={item.image_url} alt="" />
      </div>
      <div className="itemSearch__description">
        <h3>{item.name}</h3>
        <p>{`${item.distance} from center`}</p>
        <div>{item.tag}</div>
        <p>{item.description}</p>
        <div>{item.type}</div>
        <div>{item.free_cancel ? "Free cancellation" : ""}</div>
        <div>
          {item.free_cancel
            ? "You can cancel later, so lock this great price today!"
            : ""}
        </div>
      </div>
      <div className="itemSearch__review">
        <div className="item__review--rate d-flex">
          <div className="rate-text">{item.rate_text}</div>
          <div className="rate">
            <span>{item.rate}</span>
          </div>
        </div>
      </div>
    </div>
  );
};
export default ContentItem;
